import "./bulletproofLogo.css";
import { useState, useEffect } from "react";
function BulletproofLogo() {
  const [visibility, setVisibility] = useState([0, 0, 0]);

  useEffect(() => {
    setVisibility([100, 100, 100]);
    console.log(visibility);
  }, []);

  return (
    <div className="logoContainer">
      <div className="checkMarkTop" style={{ backgroundColor: visibility }} />
      <div className="checkMarkBottom" />
    </div>
  );
}

export default BulletproofLogo;
